import React from "react";
import { Container, Row, Col } from 'reactstrap';

class Footer extends React.Component {
  render() {
    return (
        <container>
          <Row>
            <Col xs="6" sm="4">.col-6 .col-sm-4</Col>
            <Col xs="6" sm="4">.col-6 .col-sm-4</Col>
            <Col sm="4">.col-sm-4</Col>
          </Row>
        </container>
    )
  }
}

export default Footer;
